import React from "react";
import { Routes, Route } from "react-router-dom"; // Import Routes and Route for routing
import App from "./App";
import QuizzesPage from "./quizzes/quizzes";  // Import the QuizzesPage component

const MainApp = () => {
  return (
    <Routes>
      <Route path="/" element={<App />} />  {/* Home page route */}
      <Route path="/quizzes" element={<QuizzesPage />} />  {/* Quizzes page route */}
    </Routes>
  );
};

export default MainApp;
